define('views/header-nav',[
  'jquery',
  'backbone'
],
function($, Backbone) {

  var HeaderNavView = Backbone.View.extend({

    events: {
      'click .js-toggle-main-nav': 'toggleMobileNav',
      'mouseenter .js-hover-subnav': 'toggleSubNav',
      'mouseleave .js-hover-subnav': 'toggleSubNav'
    },

    initialize: function() {
      this.$mainNav = $('.header__nav-sub-wrap');
      this.$mainNavToggle = $('.js-toggle-main-nav');
      this.$subNav = $('.header__nav-sub_list--level-2');
      this.$subNavToggle = $('.js-toggle-copy');
      this.$body = $(document.body);
      this.$hamburgerLabel = $('.btn-label--hamburger');
    },

    toggleMobileNav: function(e) {
      this.$mainNav.toggleClass('is-active');
      this.setMobileNavStatus();
      this.updateMainNavCopy();
    },

    updateMainNavCopy: function(e){
      if(this.$mainNav.hasClass('is-active')){
        this.$hamburgerLabel.text('Close Nav');
      } else {
        this.$hamburgerLabel.text('Open Nav');
      }

      this.$mainNavToggle.prop('title', this.$mainNavToggle.text()); // update the title property
    },

    toggleSubNav: function(e){
      var el = $(e.currentTarget);
      var targetParent = el.parent().find(this.$subNav);

      targetParent.parent().toggleClass('is-active');
      targetParent.toggleClass('is-active');
      this.updateSubNavCopy(e);
      e.preventDefault();
    },

    updateSubNavCopy: function(e){
      var el = $(e.currentTarget);
      var targetParent = el.parent().find(this.$subNav);
      var targetSubNavToggle = el.parent().find(this.$subNavToggle);

      if(targetParent.hasClass('is-active')){
        targetSubNavToggle.text('Less');
      } else {
        targetSubNavToggle.text('More');
      }
    },

    setMobileNavStatus: function(open) {
      this.$body.toggleClass('mobile-nav-open', open);
    }

  });

  return HeaderNavView;

});

