      var listSubLevel = $('.secondary-nav__list--sub-level');
      var topLevel = $('.secondary-nav__list-item--top-level');

      el.toggleClass('is-active');
      el.next(listSubLevel).toggleClass('is-active');
      el.closest(topLevel).toggleClass('is-active');

      $(el).click(function(e) {
        e.preventDefault();
      });
