$(document).ready(function () {
    if (window.history && window.history.pushState) {
        $(window).on('popstate', function () {
            //Video Overlay
            var videoTag = document.getElementsByClassName("videoTag")[0];
            var videoOverlayContainer = document.getElementsByClassName("videoOverlayContainer")[0];
            var jsToggleMedia = document.getElementsByClassName("js-toggle-media");
            if (videoTag && videoOverlayContainer) {
                videoTag.parentNode.removeChild(videoTag);
                videoOverlayContainer.style.display = "none";
                for (var i = 0; i < jsToggleMedia.length; i++) {
                    jsToggleMedia[i].setAttribute('href', '');
                }
            }

            //Generic Overlay
            var overlayContainer = document.getElementsByClassName("overlayContainer")[0];
            if (overlayContainer) {
                document.getElementById(sessionStorage.getItem('currentOverlay')).style.display = 'none';
                overlayContainer.style.display = "none";
                document.getElementsByTagName("html")[0].style.overflow = "unset";
            }

            var overlayExtraContents = document.getElementsByClassName("overlayExtraContents")[0];
            if (overlayExtraContents) {
                overlayExtraContents.parentNode.removeChild(overlayExtraContents);
            }
        });
    }

    $(document).on('click', '.js-toggle-media', function (event) {
        var hash;
        if (!$(this).data('id')) {
            hash = event.currentTarget.hash.substring(1);
            this.setAttribute('data-id', hash);
        }
        else {
            hash = $(this).data('id');
        }

        var videoSource = document.getElementById(hash);
        if (videoSource) {
            var videoPlayerVideo = videoSource.children[0];
            var title = this.title;
            if (title.length == 0) {
                title = videoPlayerVideo.currentSrc.substring((videoPlayerVideo.currentSrc.lastIndexOf('/') + 1), videoPlayerVideo.currentSrc.lastIndexOf('.'));
            }
            this.removeAttribute('href');
            var videoObject = { 'videoTitle': title, 'videoSources': videoPlayerVideo.currentSrc };
            showVideoOverlay(videoObject);
        }
    });

    $(document).on('click', '.overlayCloseButton, .overlayWrapper, .videoCloseButton, .videoOverlayWrapper, .videoTag', function (event) {
        if (!$(event.target).hasClass('videoTag')) {
            hideOverlay(event.target);
            history.back();
        }
        event.stopPropagation();
    });

    $(document).on('click', 'a', function (event) {
        var href = event.target.href != undefined ? event.target.href.toLowerCase() : '';
        if (href.substr(href.lastIndexOf('.') + 1) == 'mp4' || href.substr(href.lastIndexOf('.') + 1) == '.webm') {
            var title = href.substring((href.lastIndexOf('/') + 1), href.lastIndexOf('.'));
            var videoObject = { 'videoTitle': title, 'videoSources': href };
            showVideoOverlay(videoObject);
            event.preventDefault();
        }
    });
});

function pushVideoDataLayer(action, label) {
    dataLayer.push({
        event: "Video",
        eventCategory: "Videos",
        eventAction: action,
        eventLabel: label
    });
}

function resetSessionStorage() {
    sessionStorage.setItem('5%', false);
    sessionStorage.setItem('15%', false);
    sessionStorage.setItem('25%', false);
    sessionStorage.setItem('50%', false);
		sessionStorage.setItem('75%', false);
		sessionStorage.setItem('90%', false);
}

function saveTrackVideoCustomProgress(progress, videoTitle) {
	if(sessionStorage.getItem(progress) == 'false') {
		pushVideoDataLayer(progress + ' Played', videoTitle);
		sessionStorage.setItem(progress, true);
	}
}

/*** BEGIN NEW VIDEO OVERLAY ***/
function videoTimeUpdate(videoTitle, video) {
		var videoProgress = Math.round((video.currentTime / video.duration) * 100);

		switch(videoProgress) {
      case 5:
        saveTrackVideoCustomProgress('5%', videoTitle);
        break;

      case 15:
        saveTrackVideoCustomProgress('15%', videoTitle);
        break;

      case 25:
        saveTrackVideoCustomProgress('25%', videoTitle);
        break;

      case 50:
        saveTrackVideoCustomProgress('50%', videoTitle);
        break;

      case 75:
        saveTrackVideoCustomProgress('75%', videoTitle);
        break;

      case 90:
        saveTrackVideoCustomProgress('90%', videoTitle);
        break;
    }
}

function videoEnd(videoTitle) {
    pushVideoDataLayer("100% Played", videoTitle);
}

function videoPlay(videoTitle, video) {
    pushVideoDataLayer("Played", videoTitle);
}

/**
 Show video overlay
 Video overlay container is added to Body if it doesn't exist; otherwise, only new video container is added to the overlay container.
 videoObject = {
    'videoTitle' : '',
    'videoSources' : '' OR [],
    'data' : [{},{},...]
 }
**/
function showVideoOverlay(videoObject) {
    var sourceTag = '';
    var extension = '';
    var extraContent = '';
		var hasExtraContents = videoObject.data != undefined;

		if(!$("body").hasClass('showVideoOverlay-isActive')) {
			$("body").addClass('showVideoOverlay-isActive');

			try {
					history.pushState(null, null, null);
			} catch (ex) {
					console.error(ex.message);
			}

			//Check whether there are multiple sources or single source for the video
			if (typeof videoObject.videoSources === 'string') {
					extension = videoObject.videoSources.split('.')[videoObject.videoSources.split('.').length - 1];
					sourceTag = '<source src="' + videoObject.videoSources + '" type="video/' + extension + '">';
			} else {
					for (var i = 0; i < videoObject.videoSources.length; i++) {
							extension = videoObject.videoSources[i].split('.')[videoObject.videoSources[i].split('.').length - 1];
							sourceTag += '<source src="' + videoObject.videoSources[i] + '" type="video/' + extension + '">';
					}
			}

			//If overlay container already exists, add the new video(s) to the video container
			if (document.getElementsByClassName("videoOverlayContainer").length > 0) {
					var videoContainerDiv = document.getElementsByClassName("videoContainer")[0];
					var videoTagElement = document.createElement('video');
					videoTagElement.setAttribute('autoplay', '');
					videoTagElement.setAttribute('class', "videoTag");
					videoTagElement.setAttribute('data-title', videoObject.videoTitle);
					videoTagElement.setAttribute('controls', 'controls');
					videoTagElement.setAttribute('preload', 'none');
					videoTagElement.innerHTML = sourceTag;
					videoContainerDiv.appendChild(videoTagElement);

					if (hasExtraContents) {
							var extraContentElement = document.createElement('div');
							extraContentElement.setAttribute('class', 'overlayExtraContents');
							for (var i = 0; i < videoObject.data.length; i++) {
									extraContentElement.innerHTML += videoObject.data[i];
							}
							videoContainerDiv.appendChild(extraContentElement);
					}
			} else {
					if (hasExtraContents) {
							extraContent = '<div class="overlayExtraContents">';
							for (var i = 0; i < videoObject.data.length; i++) {
									extraContent += videoObject.data[i];
							}
							extraContent += '</div>';
					}

					var videoTag = '<video autoplay class="' + 'videoTag' + '" controls="controls" preload="none"' + 'data-title=' + videoObject.videoTitle + '>' + sourceTag + '</video>';
					var videoCloseButton = '<a title="Close" class="videoCloseButton" href="javascript:;"></a>';
					var videoContainer = '<div class="videoContainer">' + videoTag + extraContent + videoCloseButton + '</div>';
					var videoOverlayWrapper = '<div class="videoOverlayWrapper" href="javascript:;">' + videoContainer + '</div>';
					var videoOverlayContainer = document.createElement('div');
					videoOverlayContainer.setAttribute('class', 'videoOverlayContainer');
					videoOverlayContainer.innerHTML = videoOverlayWrapper;

					$("body").append(videoOverlayContainer);
			}

			//Disply the overlay container and play the video
			var video = document.getElementsByClassName("videoTag")[0];

			video.addEventListener('ended', function () {
					videoEnd(videoObject.videoTitle);
			}, false);
			video.addEventListener('timeupdate', function () {
					videoTimeUpdate(videoObject.videoTitle, video);
			}, false);

			video.addEventListener('loadeddata', function () {
					resetSessionStorage();
					videoPlay(videoObject.videoTitle, video);
					document.getElementsByClassName("videoOverlayContainer")[0].style.display = "block";
					var screenDiv = document.getElementsByClassName("videoOverlayWrapper")[0];
					var screenHeight = screenDiv.clientHeight;
					var videoContainerDiv = document.getElementsByClassName("videoContainer")[0];
					var videoContainerHeight = videoContainerDiv.clientHeight;
					if (screenHeight < videoContainerHeight) {
							var newVideoHeight = screenHeight * 0.8;
							var newVideoWidth = (newVideoHeight * videoContainerDiv.clientWidth) / videoContainerHeight;
							document.getElementsByClassName("videoTag")[0].style.width = newVideoWidth + "px";
							videoContainerDiv = document.getElementsByClassName("videoContainer")[0];
							videoContainerHeight = videoContainerDiv.clientHeight;
					}
					var screenTopPadding = window.getComputedStyle(screenDiv, null).getPropertyValue('padding-top').replace("px", "");
					var screenbottomPadding = window.getComputedStyle(screenDiv, null).getPropertyValue('padding-bottom').replace("px", "");
					var margin = (screenHeight - screenTopPadding - screenbottomPadding - videoContainerHeight) / 2 + "px";
					videoContainerDiv.style.marginTop = margin;
					videoContainerDiv.style.marginBottom = margin;
			}, false);

			video.play();
		}
}
/*** END NEW VIDEO OVERLAY ***/

/*** BEGIN GENERIC OVERLAY ***/

/*
* Helper function to generate hash value from iframe source link.
*/
function getHashValue(input) {
    var hash = 0;
    if (input == 0) return hash;
    for (i = 0; i < input.length; i++) {
        char = input.charCodeAt(i);
        hash = ((hash << 5) - hash) + char;
        hash = hash & hash;
    }
    return hash;
}

/**
 Add overlay to the body.
 overlayObject = {
    contentSource = '',
    width = '', (in percentages)
    height = '', (in percentages)
    opactiy = '', (0 to 1)
    'data' : [{},{},...],
    'scrolling': 'yes' || 'no'
 }
**/
function showOverlay(overlayObject) {
    var extraContent = '';
    var hasExtraContents = overlayObject.data != undefined;

    if (document.getElementsByClassName("overlayContainer").length > 0) {
        if (document.getElementById(getHashValue(overlayObject.contentSource))) {
            document.getElementById(getHashValue(overlayObject.contentSource)).style.display = 'block';
            sessionStorage.setItem('currentOverlay', getHashValue(overlayObject.contentSource));
        }
        else {
            sessionStorage.setItem('currentOverlay', getHashValue(overlayObject.contentSource));
            var overlayContentElement = document.createElement('iframe');
            overlayContentElement.setAttribute('class', 'overlayContentElement');
            overlayContentElement.setAttribute('src', overlayObject.contentSource);
            overlayContentElement.setAttribute('scrolling', 'yes');
            overlayContentElement.setAttribute('id', getHashValue(overlayObject.contentSource));
            document.getElementsByClassName("overlayContentWrapper")[0].appendChild(overlayContentElement);
        }

        if (hasExtraContents) {
            var extraContentElement = document.createElement('div');
            extraContentElement.setAttribute('class', 'overlayExtraContents');
            for (var i = 0; i < overlayObject.data.length; i++) {
                extraContentElement.innerHTML += overlayObject.data[i];
            }
            document.getElementsByClassName("overlayContentWrapper")[0].appendChild(extraContentElement);
        }
    } else {
        if (hasExtraContents) {
            extraContent = '<div class="overlayExtraContents">';
            for (var i = 0; i < overlayObject.data.length; i++) {
                extraContent += overlayObject.data[i];
            }
            extraContent += '</div>';
        }

        sessionStorage.setItem('currentOverlay', getHashValue(overlayObject.contentSource));
        var overlayContentElement = '<iframe class="overlayContentElement" ' + 'id="' + getHashValue(overlayObject.contentSource) + '" src="' + overlayObject.contentSource + '" scrolling="yes"></iframe>';
        var overlayContentWrapper = '<div class="overlayContentWrapper">' + overlayContentElement + extraContent + '</div>';
        var overlayCloseButton = '<a title="Close" class="overlayCloseButton" href="javascript:;"></a>';
        var overlayWrapper = '<div class="overlayWrapper">' + overlayContentWrapper + overlayCloseButton + '</div>';
        var overlayContainer = document.createElement('div');
        overlayContainer.setAttribute('class', 'overlayContainer');
        overlayContainer.innerHTML = overlayWrapper;
        $("body").append(overlayContainer);
    }

    if (hasExtraContents) {
        document.getElementsByClassName("overlayContentElement")[0].style.height = "90%";
    }

    if (overlayObject.scrolling != undefined && overlayObject.scrolling != '') {
        document.getElementsByClassName("overlayContentElement")[0].setAttribute('scrolling', overlayObject.scrolling);
    }

    document.getElementsByClassName("overlayContainer")[0].style.display = "block";
    document.getElementsByTagName("html")[0].style.overflow = "hidden";

    //Set overlay width, height and margin top
    var overlayContentWrapperDiv = document.getElementsByClassName("overlayContentWrapper")[0];
    if (overlayObject.width != undefined) {
        overlayContentWrapperDiv.style.width = overlayObject.width + "%";
    }
    if (overlayObject.height != undefined) {
        overlayContentWrapperDiv.style.height = overlayObject.height + "%";
    }

    var screenDiv = document.getElementsByClassName("overlayWrapper")[0];
    var overlayContentDiv = document.getElementsByClassName("overlayContentWrapper")[0];
    var screenTopPadding = window.getComputedStyle(screenDiv, null).getPropertyValue('padding-top').replace("px", "");
    var screenbottomPadding = window.getComputedStyle(screenDiv, null).getPropertyValue('padding-bottom').replace("px", "");
    var screenHeight = screenDiv.clientHeight;
    var overlayHeight = overlayContentDiv.clientHeight;
    var margin = (screenHeight - screenTopPadding - screenbottomPadding - overlayHeight) / 2 + "px";
    overlayContentDiv.style.marginTop = margin;
    overlayContentDiv.style.marginBottom = margin;
    overlayContentDiv.style.cssText = overlayContentDiv.style.cssText + "overflow: auto;-webkit-overflow-scrolling:touch;";

    if (overlayObject.opacity != undefined) {
        document.getElementsByClassName("overlayWrapper")[0].style.backgroundColor = "rgba(0, 0, 0, " + overlayObject.opacity + ")";
    }
    else {
        document.getElementsByClassName("overlayWrapper")[0].style.backgroundColor = "rgba(0, 0, 0, 0.5)";
    }

    try {
        history.pushState(null, null, null);
    } catch (ex) {
        console.error(ex.message);
    }
};

/**
 ** Hide the overlay, remove the iframe and remove the page's scrollbar.
 **/
function hideOverlay(target) {
		$("body").removeClass('showVideoOverlay-isActive');

    if ($(target).hasClass('overlayCloseButton') || $(target).hasClass('overlayWrapper')) {
        //Add scrollbar back to the body
        document.getElementsByTagName("html")[0].style.overflow = "unset";
        document.getElementById(sessionStorage.getItem('currentOverlay')).style.display = 'none';
        document.getElementsByClassName("overlayContainer")[0].style.display = "none";
    }
    else if ($(target).hasClass('videoCloseButton') || $(target).hasClass('videoOverlayWrapper')) {
        var videoTag = document.getElementsByClassName("videoTag")[0];
        if (videoTag) {
            videoTag.parentNode.removeChild(videoTag);
            document.getElementsByClassName("videoOverlayContainer")[0].style.display = "none";
        }
    }
    var overlayExtraContents = document.getElementsByClassName("overlayExtraContents")[0];
    if (overlayExtraContents) {
        overlayExtraContents.parentNode.removeChild(overlayExtraContents);
    }
};

